    render() {
        return (
            <Carousel autoplay>
            <div>
            <img
                className="d-block w-100"
                src={logo2}
                alt="First slide"/>
            </div>
            <div>
                <h3>2</h3>
            </div>
            <div>
                <h3>3</h3>
            </div>
            <div>
                <h3>4</h3>
            </div>
  </Carousel>
        )
    }
}

export default Home;
